def getKmer(dirVirus,outDir,outName):
    import os
    fileOut = open(outDir+'/'+outName,'w')#清楚文件中的内容
    fileOut.close()
    for dirVirus,b,virusNameList in os.walk(dirVirus):
        for eachVirusName in virusNameList:
            # print(eachVirusName)
            fileIn = open(dirVirus +'/'+ eachVirusName,'r')
            textIn = fileIn.readlines()
            fileIn.close()
            seq = ''
            for eachLine in textIn:
                # print(eachLine)
                if '>' not in eachLine:
                    seq += eachLine.strip('\n')
            dicts, seqLength = countKmerNum(seq)
            makeKmerFile(eachVirusName, dicts, seqLength, outDir, outName)
            # return eachVirusName,seq
            # break


