def makeKmerFile(virusName,dicts,seqLength,outDir,outName):
    # print(seqLength)
    # print(len(dicts))
    seqLength = float(seqLength)
    fileOut = open(outDir+'/'+outName,'a')
    fileOut.write(virusName)
    for i in range(0,len(dicts)):
        for eachItem in sorted(dicts[i].items(), key=lambda e: e[0]):
            # print(eachItem)
            eachValue = eachItem[1]/(seqLength - 1)
            # print(eachValue,end=',')
            fileOut.write(',' + '%.10f' % eachValue)
        # break
    fileOut.write('\n')
    fileOut.close()



